import { LOGIN_ROUTE, REG_ROUTE } from "../utils/consts";
import LoginForm from "../components/LoginForm";
import RegForm from "../components/RegForm";

export const publicRoutes = [
  {
    path: LOGIN_ROUTE,
    Component: LoginForm,
  },
  {
    path: REG_ROUTE,
    Component: RegForm,
  },
];
